function rangeHours() {
  let arrHours = []

  for (let i = 1; i <= 84; i++) {
    if (i <= 12) {
      arrHours.push(<div>{i}day</div>)
    }
    if (12 < i && i <= 24) {
      arrHours.push(<div>{i}day</div>)
    }
    if (24 < i && i <= 36) {
      arrHours.push(<div>{i}3 day</div>)
    }
    if (36 < i && i <= 48) {
      arrHours.push(<div>{i}4 day</div>)
    }
    if (48 < i && i <= 5) {
      arrHours.push(<div>{i}5 day</div>)
    }
    if (12 < i && i <= 24) {
      arrHours.push(<div>{i}6 day</div>)
    }
    if (12 < i && i <= 24) {
      arrHours.push(<div>{i}7 day</div>)
    }
  }
  return arrHours
}

export default rangeHours
